pragma solidity ^0.4.24;

contract ERC20Basic {
    mapping(address => uint256) balances;
    string public constant name = "Upcoda Token";
    string public constant symbol = "UPCT";
    uint8 public constant decimals = 18;
    uint256 public totalSupply;

    event Transfer(address indexed from, address indexed to, uint256 value);

    function transfer(address _to, uint256 _value) public returns (bool) {
        require(_to != address(0));
        require(_value <= balances[msg.sender]);
        balances[msg.sender] -= _value;
        balances[_to] += _value;
        Transfer(msg.sender, _to, _value);
        return true;
    }

    function balanceOf(address _owner) public view returns (uint256 balance) {
        return balances[_owner];
    }

    function ERC20Basic() public {
        totalSupply = 100000 * 10 ** uint(decimals);
        balances[msg.sender] = totalSupply;
    }
}
contract Crowdsale {

    ERC20Basic public token;

    function Crowdsale() public {
        token = new ERC20Basic();
    }

    function() payable public {
        sendTokens();
    }

    function sendTokens() public payable {
        require(msg.value > 0);

        uint tokensBought = msg.value;
        require(token.transfer(msg.sender, tokensBought));
    }

    function getContractAddress() view public returns(address){
        return this;
    }

    function getBalance() view public returns(uint){
        return this.balance;
}
}
